<node CREATED="1728339271708" ID="ID_330469978" MODIFIED="1728339277451" TEXT="import { Produto as ProdutoInterface } from &quot;@interface/produto.type&quot;;&#xa;&#xa;export class Produto {&#xa;    id: string | null;&#xa;    nome: string;&#xa;    preco: number;&#xa;    &#xa;    constructor(produto: ProdutoInterface | null) {&#xa;        if (produto === null) {&#xa;            this.id = null;&#xa;            this.nome = &apos;&apos;;&#xa;            this.preco = 0;&#xa;        } else {&#xa;            this.id = produto.id ?? null;&#xa;            this.nome = produto.nome;&#xa;            this.preco = produto.preco;&#xa;        }&#xa;    }&#xa;}">
<icon BUILTIN="tag_green"/>
