;  save{{ mi:first-upper($nameAttribute) }}() {&#xa;    if (this.{{ mi:first-lower($nameAttribute) }}Id !== &apos;new&apos;) {&#xa;      this.{{ mi:first-lower($nameAttribute) }}Service.update(this.{{ mi:first-lower($nameAttribute) }}).subscribe(&#xa;        () =&gt; {&#xa;          this.{{ mi:first-lower($nameAttribute) }}Service.showMessage(&apos;{{ $objectAttribute/properties/description/value }} editado!&apos;);&#xa;          this.router.navigate([&apos;/{{ mi:first-lower(@name) }}&apos;]);&#xa;        }&#xa;      );&#xa;    } else {&#xa;      this.{{ mi:first-lower($nameAttribute) }}Service.create(this.{{ mi:first-lower($nameAttribute) }}).subscribe(() =&gt; {&#xa;        this.{{ mi:first-lower($nameAttribute) }}Service.showMessage(&apos;{{ $objectAttribute/properties/description/value }} criado!&apos;);&#xa;        this.router.navigate([&apos;/{{ mi:first-lower(@name) }}&apos;]);&#xa;      });&#xa;    }&#xa;  }&#xa;&#xa;  cancel() {&#xa;    this.router.navigate([&apos;/{{ mi:first-lower(@name) }}&apos;]);&#xa;  }&#xa;}">
